import { makeStyles } from '@material-ui/styles'
export const useStyles = makeStyles((theme) => ({
    form:{
        background:"#171a2b !important",
        display: "flex",
        justifyContent: "center",
    },

    div:{
        border: "1px solid #5a0ef9",
        display: "flex",
        borderRadius:"."
    }

}))
